import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the cart modal (simulate clicking the cart icon)
    // Try several selectors for the cart
    let cartSelector = '.cart';
    await page.waitForSelector(cartSelector, { timeout: 5000 });
    await page.click(cartSelector);

    // Wait for cart modal/dialog to appear
    // Try to find the cart modal or cart items
    let cartModalSelector = '#cartModal';
    let cartItemsSelector = '#cartItems';
    await page.waitForSelector(cartModalSelector, { timeout: 5000 });
    await page.waitForSelector(cartItemsSelector, { timeout: 5000 });

    // Take screenshot of cart before update
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Find the first cart item quantity and increase it by 1
    // Use XPath to find the first cart-item's "+" button
    const plusButton = await page.$('//div[contains(@class,"cart-item")][1]//button[contains(@class,"quantity-btn") and text()="+"]');
    if (!plusButton) {
      throw new Error('Could not find "+" button in cart');
    }
    // Get current quantity before update
    const quantitySpan = await page.$('//div[contains(@class,"cart-item")][1]//span[contains(@class,"quantity")]');
    let quantityBefore = null;
    if (quantitySpan) {
      quantityBefore = await quantitySpan.textContent();
    }

    await plusButton.click();

    // Wait for the quantity to update (should update instantly in this UI)
    await page.waitForTimeout(500); // Short wait for DOM update

    // Take screenshot after update
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_updated.png'));

    // Extract updated quantity and item title
    const quantityAfterSpan = await page.$('//div[contains(@class,"cart-item")][1]//span[contains(@class,"quantity")]');
    let quantityAfter = null;
    if (quantityAfterSpan) {
      quantityAfter = await quantityAfterSpan.textContent();
    }
    const itemTitleEl = await page.$('//div[contains(@class,"cart-item")][1]//div[contains(@class,"cart-item-title")]');
    let itemTitle = null;
    if (itemTitleEl) {
      itemTitle = (await itemTitleEl.textContent()).trim();
    }

    // Optionally close the cart modal
    const closeBtn = await page.$('#cartModal button.close, #cartModal .close, #cartModal button[aria-label="Close"]');
    if (closeBtn) {
      await closeBtn.click();
    }

    return {
      success: true,
      action: "Updated the quantity of the first cart item by increasing it by 1",
      extractedData: {
        itemTitle,
        quantityBefore,
        quantityAfter
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
